name: Typicons
date: 06 Jul 2014
size: col-md
slug: typicons

version: 2.1.1

desc: >
  Typicons are free-to-use vector icons embedded in a webfont for easy use in any&nbsp;UI, whether it be on the web&nbsp;or in a native app.
urls:
  -
    text: Download
    link: https://github.com/stephenhutchings/typicons.font/releases/latest
  -
    text: GitHub
    link: https://github.com/stephenhutchings/typicons.font

imgs:
  cover:  /img/projects/typicons/cover.png
  reveal: /img/projects/typicons/reveal.png
metaTitle: Typicons - A Free Icon Font by Stephen Hutchings
tags:
  - Design
  - Icons
  - Fonts

image: "/img/page/typicons.png"

